import React from "react";
import MasonryItem from "./MasonryItem";

const MasonryColumn = props => {
  const ChangeStyle = e => {
    e.currentTarget.style.flex = "2";
  };
  console.log(props.columnNb);
  return (
    <div className='masonry-col' onClick={ChangeStyle}>
      <MasonryItem />
      <MasonryItem />
      <MasonryItem />
    </div>
  );
};

export default MasonryColumn;
